import React, { useEffect, useState, useRef } from 'react';

function LeagueMatchupBanner({ leagueId }) {
  const [matchups, setMatchups] = useState([]);
  const [week, setWeek] = useState(null);
  const scrollRef = useRef(null);

  useEffect(() => {
    fetch(`http://localhost:5000/api/league-matchups/${leagueId}`)
      .then(res => res.json())
      .then(data => {
        setMatchups(data.matchups);
        setWeek(data.week);
      })
      .catch(err => console.error('Error loading matchups:', err));
  }, [leagueId]);

  if (!matchups.length) return null;

  const matchupContent = matchups.map((m, i) => {
    const userScore = m.teamA?.points ?? 0;
    const oppScore = m.teamB?.points ?? 0;

    return (
      <React.Fragment key={i}>
        {i !== 0 && (
          <div
            style={{
              width: '2px',          // a bit wider so visible
              height: '40px',        // height enough to see
              backgroundColor: '#b68b2f', // gold color
              margin: '0 16px',
              alignSelf: 'center',
              borderRadius: '2px',
              flexShrink: 0,
            }}
          />
        )}
        <div
          style={{
            display: 'flex',
            alignItems: 'center',
            gap: '8px',
            padding: '0 12px',
            minWidth: '150px', // more space for each matchup
            flexShrink: 0,
            fontSize: '0.9rem',
            whiteSpace: 'nowrap',
            color: '#eee',
          }}
        >
          {m.teamA?.avatar && (
            <img
              src={`https://sleepercdn.com/avatars/thumbs/${m.teamA.avatar}`}
              alt={`${m.teamA.name} avatar`}
              style={{ width: 24, height: 24, borderRadius: '50%' }}
            />
          )}
          <span>{m.teamA?.name || 'Unknown'}</span>
          <span
            style={{
              color:
                userScore > oppScore
                  ? '#28a745'
                  : userScore < oppScore
                  ? '#dc3545'
                  : '#f5e96e',
              fontWeight: '600',
            }}
          >
            {userScore}
          </span>

          <span style={{ color: '#aaa' }}>vs</span>

          {m.teamB?.avatar && (
            <img
              src={`https://sleepercdn.com/avatars/thumbs/${m.teamB.avatar}`}
              alt={`${m.teamB.name} avatar`}
              style={{ width: 24, height: 24, borderRadius: '50%' }}
            />
          )}
          <span>{m.teamB?.name || 'Bye'}</span>
          <span
            style={{
              color:
                oppScore > userScore
                  ? '#28a745'
                  : oppScore < userScore
                  ? '#dc3545'
                  : '#f5e96e',
              fontWeight: 'bold',
            }}
          >
            {oppScore}
          </span>
        </div>
      </React.Fragment>
    );
  });

  return (
    <div
      style={{
        width: '100vw',
        overflow: 'hidden',
        backgroundColor: '#111',
        borderTop: '2px solid #f2f0e6',
        borderBottom: '2px solid #f2f0e6',
        color: '#eee',
        height: '4rem',
        display: 'flex',
        alignItems: 'center',
        fontFamily: 'Segoe UI, sans-serif',
        userSelect: 'none',
      }}
    >
      <div
        ref={scrollRef}
        style={{
          display: 'flex',
          animation: 'scroll-left 60s linear infinite', // slower scrolling
          width: 'max-content',
        }}
      >
        {/* duplicate twice for smooth infinite scroll */}
        <div style={{ display: 'flex' }}>{matchupContent}</div>
        <div style={{ display: 'flex' }}>{matchupContent}</div>
      </div>

      <style>{`
        @keyframes scroll-left {
          0% {
            transform: translateX(0);
          }
          100% {
            transform: translateX(-50%);
          }
        }
      `}</style>
    </div>
  );
}

export default LeagueMatchupBanner;
